import React from "react";
import { Canvas } from "react-three-fiber";
import { GLTFLoader } from "three/examples/jsm/loaders/GLTFLoader";
import RubiksCubeModel from "./RubiksCubeModel";
import { MouseEventsProvider } from "./MouseEventsContext";
import "./App.css";
import { useLoader } from "react-three-fiber";

const RubiksCube = () => {
  const { scene } = useLoader(GLTFLoader, "/rubikcube.gltf");

  return (
    <Canvas>
      <ambientLight />
      <pointLight position={[10, 10, 10]} />
      <MouseEventsProvider>
        <Suspense fallback={null}>
          {scene.children.map((nodesSubset, index) => (
            <RubiksCubeModel key={index} index={index} nodesSubset={[nodesSubset]} />
          ))}
        </Suspense>
      </MouseEventsProvider>
    </Canvas>
  );
};

export default RubiksCube;
